var AppRouter = Backbone.Router.extend({
  routes: {
    "tabs":     "selectTab",
    "tabs/:id": "showTab",
    "*actions": "selectTab",
    // matches http://example.com/#anything-here
  }
});

// Initiate the router
var app_router = new AppRouter;

app_router.on('route:selectTab', function(actions) {
  alert(actions);
})

app_router.on('route:showTab', function(tabName) {
  $.getJSON("/tabs/" + tabName, function(json) {
    var tabString = json.tab;

    var tp = new TabParser();
    tab = tp.parse(tabString);

    player = new Player;

    tabView = new TabView({
      el: $('#tab'),
      model: tab,
      player: player
    });

    noteSelectorView = new NoteSelectorView({
    });

    playerView = new PlayerView({
      player: player
    });

    cursorView = new CursorView({
      tabView: tabView,
      el: $('body')
    });

    $(document).on('keydown', function(e) {
      console.log(e.keyCode);
  
      if (e.keyCode == 9) { // \t
        if (e.shiftKey) {
          noteSelectorView.selectPrevNote();
        } else {
          noteSelectorView.selectNextNote();
        }
        e.preventDefault();
      } else if (e.keyCode == 32) { // space
        if (player.player) {
          playerView.stop();
        } else {
          playerView.start();
        }
        e.preventDefault();
      } else if (e.keyCode == 40) { // down
        cursorView.moveDown();
        e.preventDefault();
      } else if (e.keyCode == 38) { // up
        cursorView.moveUp();
        e.preventDefault();
      } else if (e.keyCode == 39) { // right
        cursorView.moveRight();
        e.preventDefault();
      } else if (e.keyCode == 37) { // left
        cursorView.moveLeft();
        e.preventDefault();
      } else if (e.keyCode == 74) { // j
        cursorView.moveDown();
        e.preventDefault();
      } else if (e.keyCode == 75) { // k
        cursorView.moveUp();
        e.preventDefault();
      } else if (e.keyCode == 76) { // l
        cursorView.moveRight();
        e.preventDefault();
      } else if (e.keyCode == 72) { // h
        cursorView.moveLeft();
        e.preventDefault();
      } else if (e.keyCode >= 48 && e.keyCode <= 57) { // integer
        cursorView.setFret(String.fromCharCode(e.keyCode))
        e.preventDefault();
      }
    });
  });
})

